import React, { useEffect, useState } from "react";
import { Link, Outlet } from "react-router-dom";
import Footer from "./Footer";


const Navbar = () => {
  // const placeholders = ["Facial", "AC Service", "Kitchen Cleaning"];
  // const [placeholderIndex, setPlaceholderIndex] = useState(0);

  // useEffect(() => {
  //   const interval = setInterval(() => {
  //     setPlaceholderIndex((prevIndex) => (prevIndex + 1) % placeholders.length);
  //   }, 2000);

  //   return () => clearInterval(interval); // Cleanup on unmount
  // }, []);
  const texts = ["Facial", "AC Service", "Kitchen Cleaning"];
  const [index, setIndex] = useState(0);
  const [animatedText, setAnimatedText] = useState(texts[0]);

  useEffect(() => {
    const interval = setInterval(() => {
      setIndex((prevIndex) => (prevIndex + 1) % texts.length);
    }, 3000); // Har 3 sec baad text change hoga

    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    let charIndex = 0;
    setAnimatedText(""); // Text clear before typing starts

    const typingInterval = setInterval(() => {
      if (charIndex < texts[index].length) {
        setAnimatedText((prev) => prev + texts[index][charIndex]);
        charIndex++;
      } else {
        clearInterval(typingInterval);
      }
    }, 150); // Har letter 150ms me appear hoga

    return () => clearInterval(typingInterval);
  }, [index]);

  return (
    
    <div>
    <nav className="navbar navbar-expand-lg bg-white shadow-sm">
      <div className="container">
        {/* Brand Logo */}
        <a className="navbar-brand fw-bold" href="#">
          <img src="https://res.cloudinary.com/urbanclap/image/upload/t_high_res_category/w_108,dpr_2,fl_progressive:steep,q_auto:low,f_auto,c_limit/images/growth/home-screen/1687285683825-e6cf23.jpeg" alt="Logo" height="40" />
        </a>

        {/* Toggle Button for Mobile */}
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
        >
          <span className="navbar-toggler-icon"></span>
        </button>

        {/* Navbar Links */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav mx-auto">
            {/* Location Selector */}
            <li className="nav-item dropdown">
              <a
                className="nav-link dropdown-toggle"
                href="#"
                id="locationDropdown"
                role="button"
                data-bs-toggle="dropdown"
              >
                <i className="bi bi-geo-alt"></i> Chandigarh, India
              </a>
              <ul className="dropdown-menu">
                <li><a className="dropdown-item" href="#">Delhi</a></li>
                <li><a className="dropdown-item" href="#">Mumbai</a></li>
                <li><a className="dropdown-item" href="#">Bangalore</a></li>
              </ul>
            </li>

            {/* Search Bar */}
            <li className="nav-item">
              {/* <form className="d-flex">
                <input className="form-control me-3 px-3 placeholder-slide" type="search" placeholder={`Search for '${placeholders[placeholderIndex]}'`} style={{ width: "250px" }} />
                <button className="btn btn-outline-secondary" type="submit">Search</button>
                <style>
        {`
          @keyframes slide {
            0% { opacity: 0; transform: translateY(10px); }
            50% { opacity: 0.5; transform: translateY(5px); }
            100% { opacity: 1; transform: translateY(0); }
          }
          .placeholder-slide::placeholder {
            animation: slide 0.5s ease-in-out;
          }
        `}
      </style>
              </form> */}
              <form className="d-flex" style={{ position: "relative" }}>
      <input
        className="form-control me-2"
        type="search"
        placeholder=" " // Real placeholder empty rakha
        style={{ width: "400px" }}
      />
      <span
        style={{
          position: "absolute",
          left: "15px",
          top: "50%",
          transform: "translateY(-50%)",
          color: "#aaa",
          pointerEvents: "none",
          fontSize: "16px",
          whiteSpace: "nowrap",
          transition: "opacity 0.5s ease-in-out",
        }}
      >
        Search for '{animatedText}
      </span>
      <button className="btn btn-outline-secondary" type="submit">
        Search
      </button>
    </form>
            </li>
          </ul>

          {/* Right-side Icons */}
          <div className="d-flex">
          <Link className="nav-link" to="frontblogs"><i class="fa-solid fa-blog  me-3" style={{color:"black"}}></i></Link>
            <Link  className="me-3" to="viewaddtocart" style={{color:"black"}}><i class="fa-solid fa-cart-shopping"></i></Link>
            <Link to="SignUp" style={{color:"black"}}><i class="fa-solid fa-user"></i></Link>

          </div>
        </div>
      </div>
    </nav>
    <Outlet/>
    <Footer/>
    </div>
  );
};

export default Navbar;
